import React from "react";
import NavBar from "./pages/NavBar";
import Home from "./pages/Home";
import About from "./pages/About";
import ProjectList from "./pages/ProjectList";

function App() {

  const alex = {
    name: "Alex",
    city: "New York",
    bio: "",
    color: "firebrick",
    links: {
      github: "https://github.com/AlexManzi",
      linkedin: "https://www.linkedin.com/in/alex-manzi-51804023b/",
    },
    projects: [
      {
        id: 1,
        name: "ad:Aquila",
        about: "an advertisement management application that allows companies to view, create, and update ad campaigns across radio, TV, and the Internet.",
        technologies: ["React", "Rails", "JavaScript", "CSS"],
      },
      {
        id: 2,
        name: "Blockaline",
        about: "a job posting website for jobs within the cryptocurrency and blockchain industries. Users can signup and login to the website and create job postings, save job postings to a favorites folder, and apply for other job postings.",
        technologies: ["React", "Rails", "JavaScript", "CSS"],
      },
      {
        id: 3,
        name: "Shopify 2.0",
        about: "Etsy for aliens",
        technologies: ["React", "Ruby", "JavaScript", "CSS"],
      },
      {
        id: 4,
        name: "Sus Row Records",
        about: "Etsy for aliens",
        technologies: ["React", "Redux", "Rails"],
      },
      {
        id: 5,
        name: "Cryptonaire",
        about: "Etsy for aliens",
        technologies: ["React", "Redux", "Rails"],
      }
    ],
  };
  return (
    <div>
      <NavBar />
      <Home alex={alex} />
      <About alex={alex} />
      <ProjectList alex={alex} />
    </div>
  );
}

export default App;
